import React, { useState } from "react";
import UserList from "./UserList";
const ModalListUser = (props) => {
    const {  onClose,selectedUserId,handleSelectUser } = props;
    //const [selectedUserId, setSelectedUserId] = useState(null);

   
    

    return (
        <div className="modal" tabIndex="-1" role="dialog" style={{ display: "block" }}>
            <div className="modal-dialog" role="document">
                <div className="modal-content">
                    <div className="modal-header">
                        <button
                            type="button"
                            className="close"
                            data-dismiss="modal"
                            aria-label="Close"
                            onClick={onClose}
                        >
                            <span aria-hidden="true">&times;</span>
                        </button>
                    </div>
                    <div className="modal-body">

                        <UserList
                            hideButtons={true}
                            selectedUserId={selectedUserId}
                            handleSelectUser={onClose}
                            
                        />
                    </div>
                    <div className="modal-footer">
                        <button type="button" className="btn btn-secondary" data-dismiss="modal" onClick={onClose}>
                            Cancelar
                        </button>

                    </div>
                </div>
            </div>
        </div>
    );
};

export default ModalListUser;
